import './App.css';
import React, { useEffect, useState } from 'react';
import Navbar from './components/navbar';
import SearchBox from './components/searchBox';
import Home from './pages/home';
import { FetchMealByFirstLetter } from './services/mealtService.js';

function App() {

	const filt = "Bakewell tart"
	const [meals, setMeals] = useState([]);

	useEffect(() => {
		async function fetchMeals() {
			try {
				const data = await FetchMealByFirstLetter();
				setMeals(data);
			} catch (error) {
				console.error('Error al obtener comidas:', error);
			}
		}

		fetchMeals();
	}, []);

	
	const filteredProducts = filt === ""
    ? meals
    : meals.filter((product) => product.strMeal === filt);



	return (
		<div className='App'>
			<Navbar>
				<SearchBox />
			</Navbar>
			<Home meals={filteredProducts} />
		</div>
	);
}

export default App;
